	private Integer getVolumeFromHtml(String html) {
		int indiceIniVol = -1;
		int indiceFinalVol = -1;
		for (int i =0; i < 4; i++){
			indiceIniVol = html.indexOf("<td", ++indiceIniVol);
			indiceFinalVol = html.indexOf("</td>", ++indiceFinalVol);
		}
		 return Integer.parseInt(html.substring(indiceIniVol+18, indiceFinalVol).trim().replace(".", ""));
	}
	
	private void ordenarCotacoes(List<CotacaoOpcaoTO> cotacoesOpcoes) {
		if (cotacoesOpcoes.size() > 0) {
			Collections.sort(cotacoesOpcoes, new CotacaoOpcaoVolumeComparator());
		}
	}
	
