	private boolean isDataOpcaoValida(String dataSerie) {
		try {
			return (DataUtil.getDiferencaDias(DataUtil.getDataAtual(), DataUtil.converteToDate(dataSerie)) >= 0);
		} catch (Exception e) {
			// TODO: handle exception
			e.printStackTrace();
		}
		return false;
	}
	
	
